import React from 'react';
import './HomeContenedor.css';

const HomeContenedor = ({ language }) => {
  return (
    <section className='contenedorprincipal'>
      <div className='contenedorhome'>
        <h1>{language === 'es' ? '  Cinepolis' : 'CINEPOLIS'}</h1>

      </div>
      <div className='styleimg'>
        <div>
          <div className='tecnologias1'>
            <a href="https://cinepolis.com.gt/" target="_blank" rel="noopener noreferrer">
              <img src="https://firebasestorage.googleapis.com/v0/b/cine-245c1.appspot.com/o/logo.jpg?alt=media&token=cedb2b95-8f85-42e5-805d-2a1ab2984e7d" alt="Logo UVG" />
            </a>
          </div>
          <img src="https://firebasestorage.googleapis.com/v0/b/cine-245c1.appspot.com/o/palo.jpg?alt=media&token=e8bd22b0-3150-4bc3-a077-3d0139a61c96" alt="UVG logo" />
        </div>

      </div>
    </section>
  );
};

export default HomeContenedor;
